import { FunctionComponent, useEffect } from "react";
import Navbar from "../components/navbar";
import { TweenMax, Power4, Elastic, Bounce } from 'gsap';

const SignUpPage: FunctionComponent = () => {
  useEffect(() => {
    // Store the animated element in a variable
    const animatedElement = document.querySelector('.animated-element');

    // Check if the element exists
    if (animatedElement) {
      // Set initial CSS properties (off-screen position)
      TweenMax.set(animatedElement, { x: '-100%', y: '-100%', opacity: 0, rotation: -180 });

      // Animate the element's entrance
      TweenMax.to(animatedElement, 2, {
        x: '0%',
        y: '0%',
        opacity: 1,
        rotation: 0,
        ease: Elastic.easeOut.config(1, 0.5),
        delay: 0.5, // Delay before the animation starts
      });

      // Add a bouncing effect
      TweenMax.to(animatedElement, 1, {
        y: '+=20',
        repeat: -1,
        yoyo: true,
        ease: Bounce.easeInOut,
      });

      // Add a pulsating effect
      TweenMax.to(animatedElement, 0.5, {
        scale: 1.2,
        repeat: -1,
        yoyo: true,
        ease: Power4.easeInOut,
      });
    }
  }, []);

  return (
    <div className="relative bg-white w-full h-[1024px] overflow-hidden text-left text-11xl text-white font-inter">
      <Navbar />
      <div className="absolute top-[50px] left-[50px] right-[50px] bottom-[50px] text-9xl text-darkslategray-100 font-sora border border-silver p-4">
        <div className="relative">
          <img
            className="absolute top-[0px] left-[50%] transform translateX(-50%) w-[720px] h-[628px] object-cover animated-element"
            alt=""
            src="/httpslottiefilescomanimationsloginwles6gkjqx@2x.png"
          />
        </div>
        <b className="block text-21xl text-black w-[181px] h-[49px] mx-auto">SIGNUP</b>
        <div className="mt-4 space-y-4">
          <div className="font-light">
            <label htmlFor="email">Enter your Email id</label>
            <input type="text" id="email" className="block w-full rounded-sm bg-white border border-silver" />
          </div>
          <div className="font-light">
            <label htmlFor="password">Enter password</label>
            <input type="password" id="password" className="block w-full rounded-sm bg-white border border-silver" />
          </div>
          <div className="font-light">
            <label htmlFor="confirmPassword">Enter password again</label>
            <input type="password" id="confirmPassword" className="block w-full rounded-sm bg-white border border-silver" />
          </div>
          <div className="font-light">
            <label htmlFor="name">Enter your name</label>
            <input type="text" id="name" className="block w-full rounded-sm bg-white border border-silver" />
          </div>
        </div>
        <div className="mt-4">
          <button className="bg-darkslategray-100 text-white py-2 px-4 rounded-lg hover:bg-gray-800 focus:outline-none focus:ring-2 focus:ring-gray-400">
            Sign up
          </button>
        </div>
      </div>
    </div>
  );
};

export default SignUpPage;
